import './App.css';
import Logo from "./componentes/logo/index"

function App() {
  return (
    <div className='App'>
      <header className='appHeader'>
      <Logo></Logo>
      <ul className='optionsHeader'>
        <li className='options'><p>HOME</p></li>
        <li className='options'><p>SOBRE</p></li>
        <li className='options'><p>MINHA ESTANTE</p></li>
        <li className='options'><p>FAVORITOS</p></li>
      </ul>
      </header>
    </div>
    );
}

export default App;
